/* eslint-disable no-dupe-keys */
/* eslint-disable jsx-a11y/anchor-is-valid */
import React, { useState, useEffect } from "react";
import axios from "axios";
import Slider from "react-slick";

const Brand = (props) => {
  const settings = {
    className: "center",
    centerMode: true,
    infinite: true,
    speed: 500,
    slidesToShow: 5,
    slidesToScroll: 1,
    autoplaySpeed: 2000,
    autoplay: true,
    pauseOnHover: true,
    initialSlide: 0,
    nextArrow: <SampleNextArrow />,
    prevArrow: <SamplePrevArrow />,
    centerPadding: "20px",
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 3,
          slidesToScroll: 1,
          autoplay: false,
          swipeToSlide: true,
          nextArrow: false,
          prevArrow: false,
        },
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 2,
          initialSlide: 2,
          autoplay: false,
          swipeToSlide: true,
          nextArrow: false,
          prevArrow: false,
        },
      },
      {
        breakpoint: 480,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
          autoplay: false,
          swipeToSlide: true,
          nextArrow: false,
          prevArrow: false,
        },
      },
    ],
  };

  function SampleNextArrow(props) {
    const { className, style, onClick } = props;
    return (
      <div
        className={className}
        style={{
          ...style,
          display: "block",
          background: "black",
          marginRight: "1rem",
          zIndex: "2",
          borderRadius: "50%",
        }}
        onClick={onClick}
      />
    );
  }

  function SamplePrevArrow(props) {
    const { className, style, onClick } = props;
    return (
      <div
        className={className}
        style={{
          ...style,
          display: "block",
          background: "black",
          marginLeft: "1rem",
          zIndex: "2",
          borderRadius: "50%",
        }}
        onClick={onClick}
      />
    );
  }

  const arr = [
    {
      img: "https://lumen.thinkpro.vn/backend/uploads/brand/icon/2020/8/7/dell.png",
    },
    {
      img: "https://lumen.thinkpro.vn/backend/uploads/brand/icon/2020/8/7/razer.png",
    },
    {
      img: "https://lumen.thinkpro.vn/backend/uploads/brand/icon/2020/8/7/lenovo.png",
    },
    {
      img: "https://lumen.thinkpro.vn/backend/uploads/brand/icon/2020/8/7/asus.png",
    },
    {
      img: "https://lumen.thinkpro.vn/backend/uploads/brand/icon/2020/8/7/hp.png",
    },
    {
      img: "https://lumen.thinkpro.vn/backend/uploads/brand/icon/2020/8/7/microsoft.png",
    },
    {
      img: "https://lumen.thinkpro.vn/backend/uploads/brand/icon/2020/8/7/apple.png",
    },
    {
      img: "https://lumen.thinkpro.vn/backend/uploads/brand/icon/2020/9/24/5f6c4ee7ed9fd_1600933607.png",
    },
    {
      img: "https://lumen.thinkpro.vn/backend/uploads/brand/icon/2020/8/7/dell.png",
    },
  ];

  return <Slider {...settings}></Slider>;
};

export default Brand;
